# Co-Inertia Analysis
.pull-left[
- Multivariate analysis technique introduced by Doledec et al. (1994)
    - Seeks to find axes that maximize projected co-inertia, a generalization of covariance

- Applied in ecology (Dray et al. 2003) and microarray platform comparisons (Culhane et al. 2003)

- Min et al. (2018) extended original method to select for sparsity and incorporate connectivity information
]

.pull-right[
&lt;img src="COIA_fig.png" width="75%" /&gt;
]



---

# Co-Inertia Analysis
- Let `\(X \in \mathbb{R}^{n \times p}\)` be a centered dataset and define inertia as
`$$I_{x}=\sum_{i=1}^{n} d_{i}\left\|x_{i}\right\|_{Q_{x}}^{2}=\operatorname{trace}\left(X Q_{x} X^{T} D\right)$$`
where `\(\langle X, X\rangle_{Q_x}=X Q_{x} X^{T}\)`, `\(D = \operatorname{diag}\left\{d_{1}, \ldots, d_{n}\right\}\)` is the matrix of row weights, and `\(Q_{x}=\operatorname{diag}\left\{q_{1}, \ldots, q_{p}\right\}\)` is the matrix of column weights of `\(X\)`

- When `\(D = \frac{1}{n} I\)` and `\(Q_x = I\)`, this reduces to the sum of the variances 

- Let `\(Y \in \mathbb{R}^{n \times q}\)` be another centered dataset for the same subjects

- For projections `\(XQ_x \boldsymbol{u}\)` and `\(YQ_y \boldsymbol{v}\)` we can define the co-inertia between the projections as
`$$I_{c}(\boldsymbol{u}, \boldsymbol{v}) = \left(\boldsymbol{u}^{T} Q_x X^T DY Q_y \boldsymbol{v}\right)^{2}$$`
where `\(Q_{y} \in \mathbb{R}^{q \times q}\)` is the matrix of column weights of `\(Y\)`

---

# Structured Sparse CIA
- We can incorporate prior knowledge in the form of a undirected graph via the Laplacian penalty (Li and Li 2008)

- Define the normalized Laplacian matrix for a graph `\(\mathcal{G}_{x}\)` representing network information about the variables in `\(X\)` as
`$$L_{x}(i, j)=\left\{\begin{array}{ll}{1-w_{x}(i, j) / d_{i},} &amp; {\text { if } i=j \text { and } d_{i} \neq 0} \\ {-w_{x}(i, j) / \sqrt{d_{i} d_{j}},} &amp; {\text { if } i \text { and } j \text { are adjacent }} \\ {0,} &amp; {\text { otherwise }}\end{array}\right.$$`
where `\(w_{x}(i, j)\)` is the weight of edge `\(e = (i \sim j)\)` and `\(d_i\)` is the degree of vertex `\(i\)` defined as `\(\sum_{i \sim j} w_{x}(i, j)\)` 

- The Laplacian penalty on `\(\boldsymbol{u}\)` in this problem can be written as
`$$\boldsymbol{u}^{T} L_x \boldsymbol{u}=\sum_{i \sim j}\left(\frac{u_i}{\sqrt{d_{i}}}-\frac{u_j}{\sqrt{d_{j}}}\right)^2 w_x(i, j)$$`



---

# Structured Sparse CIA
- Incorporating the Laplacian penalty as well as L1 penalty leads to the following optimization problem
`$$\begin{aligned} \underset{a, b}{\text{maximize}} \quad \boldsymbol{a}^{T} \tilde{X}^T \tilde{Y} \boldsymbol{b} \quad \text{subject to}  \quad &amp; \|\boldsymbol{a}\|_2 \leq 1,\|\boldsymbol{b}\|_2 \leq 1, \|\boldsymbol{a}\|_1 \leq c_1,\|\boldsymbol{b}\|_1 \leq c_2, \\ &amp; \boldsymbol{a}^{T} \tilde{L}_{x} \boldsymbol{a} \leq c_{3}, \boldsymbol{b}^{T} \tilde{L}_{y} \boldsymbol{b} \leq c_{4} \end{aligned}$$`
where `\(\tilde{L}_{x}=Q_{x}^{-1 / 2} L_{x} Q_{x}^{-1 / 2}\)` and `\(\tilde{L}_{y}=Q_{y}^{-1 / 2} L_{y} Q_{y}^{-1 / 2}\)`

- After some algebra, this can also be reformulated as an iterative optimization problem involving two penalized least squares problems

- Tuning parameters selected via five-fold cross-validation

# Conclusions
- Several improvements made over original ssCIA procedure 

    - Extension  to enable controlling of confounders

    - Modified CV objective function produces sparse results

    - Particle swarm optimization shows marked improvement over grid search for CV

- Method produces biologically feasible results

    - Both imaging and genetic findings consistent with previous literature
    
    - Potentially identifies novel associations

---

# Future Directions
- Additional modifications of ssCIA analysis plan

    - Exploration of CV objective function to balance sparsity and performance

    - Examination of alternate imaging phenotypes

- Apply multiple CIA to incorporate additional datasets

- Extension to voxel-wise analysis via tensor CIA

- Develop CIA method to isolate associations within subgroups

# Co-Inertia Analysis
- Let `\(X \in \mathbb{R}^{n \times p}\)` be a centered dataset and define inertia as
`$$I_{x}=\sum_{i=1}^{n} d_{i}\left\|x_{i}\right\|_{Q_{x}}^{2}=\operatorname{trace}\left(X Q_{x} X^{T} D\right)$$`
where `\(\langle X, X\rangle_{Q_x}=X Q_{x} X^{T}\)`, `\(D = \operatorname{diag}\left\{d_{1}, \ldots, d_{n}\right\}\)` is the matrix of row weights, and `\(Q_{x}=\operatorname{diag}\left\{q_{1}, \ldots, q_{p}\right\}\)` is the matrix of column weights of `\(X\)`

- When `\(D = \frac{1}{n} I\)` and `\(Q_x = I\)`, this reduces to the sum of the variances 

- Let `\(Y \in \mathbb{R}^{n \times q}\)` be another centered dataset for the same subjects and define co-inertia as
`$$I_{c}=\operatorname{trace}\left(X Q_x X^{T} DY Q_y Y^{T} D\right)$$`
where `\(Q_{y} \in \mathbb{R}^{q \times q}\)` is the matrix of column weights of `\(Y\)`


---

# Co-Inertia Analysis
- For projections `\(XQ_x \boldsymbol{u}\)` and `\(YQ_y \boldsymbol{v}\)` we can define the co-inertia between the projections as
`$$I_{c}(\boldsymbol{u}, \boldsymbol{v}) = \left(\boldsymbol{u}^{T} Q_x X^T DY Q_y \boldsymbol{v}\right)^{2}$$`

- CIA seeks to find `\((\boldsymbol{u}, \boldsymbol{v})\)` that maximizes projected co-inertia, similar to how CCA finds linear combinations that maximize correlation

- The optimization problem for CIA can be expressed as

`$$\underset{u, v}{\text{maximize}} \left(\boldsymbol{u}^{T} Q_x X^T DY Q_y \boldsymbol{v}\right)^{2} \quad \text{subject to}  \quad \boldsymbol{u}^{T} Q_x \boldsymbol{u}=\boldsymbol{v}^{T} Q_y \boldsymbol{v}=1$$`

- Loading vectors can be obtained via eigenvalue decomposition of `\(Q_{x}^{1 / 2} X^{T} DYQ_{y} Y^{T} D X Q_{x}^{1 / 2}\)`


---

# Sparse Co-Inertia Analysis
- Imposing an `\(l_1\)` constraint and making some substitutions we can instead solve
`$$\underset{a, b}{\text{maximize}} \quad \boldsymbol{a}^{T} \tilde{X}^T \tilde{Y} \boldsymbol{b} \quad \text{subject to}  \quad \|\boldsymbol{a}\|_2 \leq 1,\|\boldsymbol{b}\|_2 \leq 1, \|\boldsymbol{a}\|_1 \leq c_1,\|\boldsymbol{b}\|_1 \leq c_2$$`
where `\(a=Q_{x}^{1 / 2} \boldsymbol{u}, b=Q_{v}^{1 / 2} \boldsymbol{v}, \tilde{X}=D^{1 / 2} X Q_{x}^{1 / 2} \text { and } \tilde{Y}=D^{1 / 2} Y Q_{y}^{1 / 2}\)`

- Note that the `\(l_2\)` equality constraint is relaxed to an inequality to achieve biconvexity in `\(\boldsymbol{a}\)` and `\(\boldsymbol{b}\)`

- After finding the Lagrangian form of the problem, we can apply block relaxation by fixing one loading vector to obtain
`$$\boldsymbol{a} \leftarrow \arg \min _{a} \quad \frac{1}{2}\|\tilde{X}^{T} \tilde{Y} \boldsymbol{b} - \boldsymbol{a} \|_{2}^{2}+\lambda_{1}\|\boldsymbol{a}\|_{1}$$`
`$$\boldsymbol{b} \leftarrow \arg \min _{b} \quad \frac{1}{2}\|\tilde{Y}^{T} \tilde{X} \boldsymbol{a} - \boldsymbol{b} \|_{2}^{2}+\lambda_{2}\|\boldsymbol{b}\|_{1}$$`
which are two penalized least squares problems that can be iteratively solved until convergence

---

# K-Fold Cross-Validation
- Tuning parameters selected by splitting subjects into `\(K\)` subgroups where one is used as test set at a time

- Co-inertia axes found in training set then applied to test set

- Original ssCIA paper chose tuning parameters maximizing
`$$CV(\lambda) = \frac{1}{K} \sum_{k=1}^K (\hat{u}_{-k}(\lambda)^T Q_x X_k^T D Y_k Q_y \hat{v}_{-k}(\lambda))^2$$`
where `\(\hat{u}_{-k}(\lambda)\)` and `\(\hat{v}_{-k}(\lambda)\)` are the estimated loading vectors after removing the `\(k^{th}\)` subgroup with tuning parameters `\(\lambda\)`, and `\(X_k\)`, `\(Y_k\)` are the datasets of the `\(k^{th}\)` subgroup

- Does not yield sparse results for this analysis

- Modified CV to use standardized mean, penalizing high variance in test set results

`$$\small{CV_{S}(\lambda) = \frac{\frac{1}{K} \sum_{k=1}^K (\hat{u}_{-k}(\lambda)^T Q_x X_k^T D Y_k Q_y \hat{v}_{-k}(\lambda))^2}
{\sqrt{\frac{1}{K} \sum_{k=1}^K \left( (\hat{u}_{-k}(\lambda)^T Q_x X_k^T D Y_k Q_y \hat{v}_{-k}(\lambda))^2 - \frac{1}{K} \sum_{k=1}^K (\hat{u}_{-k}(\lambda)^T Q_x X_k^T D Y_k Q_y \hat{v}_{-k}(\lambda))^2 \right)^2}}}$$`

# ADNI Imaging Data
- Baseline 1.5T MP-RAGE sequence scans were obtained and preprocessed by ADNI investigators

- Further processing performed by Shen lab members involving alignment to each participant's same visit scan and normalization to the Montreal Neurological Institute (MNI) space as 1x1x1 mm^3 voxels

- Obtained ROI-level grey matter densities by taking the mean within each of 116 ROIs based on the MarsBaR AAL atlas

&lt;table border=1&gt;
&lt;tr&gt; &lt;th&gt; IID &lt;/th&gt; &lt;th&gt; MNI_Precentral_L &lt;/th&gt; &lt;th&gt; MNI_Precentral_R &lt;/th&gt; &lt;th&gt; MNI_Frontal_Sup_L &lt;/th&gt;  &lt;/tr&gt;
  &lt;tr&gt; &lt;td&gt; 002_S_0413 &lt;/td&gt; &lt;td align="right"&gt; 0.36 &lt;/td&gt; &lt;td align="right"&gt; 0.33 &lt;/td&gt; &lt;td align="right"&gt; 0.37 &lt;/td&gt; &lt;/tr&gt;
   &lt;/table&gt;

- Structural connectivity information was derived from ADNI dMRI images as density of fiber between ROIs

- Yielded undirected weighted graphs with the 116 ROIs as vertices

---

# ADNI Expression Data
- Affymetrix Human Genome U219 Array for expression profiling of blood samples

- ADNI investigators processed the images, normalized expression levels across subjects via NMA normalization, and performed quality control

- 19037 genes in dataset after processing

    - Gene expression data was subsetted to only probes matching a single HGNC symbol
    
    - HGNC symbols with multiple probes were aggregated by taking the mean

&lt;table border=1&gt;
&lt;tr&gt; &lt;th&gt; ID &lt;/th&gt; &lt;th&gt; A1BG &lt;/th&gt; &lt;th&gt; A1CF &lt;/th&gt; &lt;th&gt; A2M &lt;/th&gt; &lt;th&gt; A2ML1 &lt;/th&gt;  &lt;/tr&gt;
  &lt;tr&gt; &lt;td&gt; 002_S_0413 &lt;/td&gt; &lt;td align="right"&gt; 3.02 &lt;/td&gt; &lt;td align="right"&gt; 2.53 &lt;/td&gt; &lt;td align="right"&gt; 3.48 &lt;/td&gt; &lt;td align="right"&gt; 2.22 &lt;/td&gt; &lt;/tr&gt;
   &lt;/table&gt;

- Network information was obtained from the KEGG pathway database

- Only subjects with both types of data ( `\(n = 723\)` : 41 AD, 207 EMCI, 222 LMCI, 253 CN patients) were included
